import { Box, Grid, Paper, makeStyles } from "@material-ui/core"
import Header from "../../componets/header"

const useStyles = makeStyles({
    paddingTop10: {
        paddingTop: "10%"
    },
    alingPaper: {
        padding: 20, 
        textAlign: 'center',

    },
    box: {
        backgroundColor: "#E1E1E1"
    },
    height100: {
        height: "100%"
    }
})

function PageMain(){
    const classes = useStyles()
    return(
        <Box>
            <Box>
                <Header/>
            </Box>
            <Box>
            <Grid container spacing={2} className={`${classes.paddingTop10}`}>
                <Grid item xs={4}>
                    <Box className={`${classes.alingPaper} ${classes.box} ${classes.height100}`}>
                        Box
                    </Box>
                </Grid>
                <Grid item xs={4}>
                    <Paper className={classes.alingPaper} elevation={4}>
                    Conteúdo da Coluna 2
                    </Paper>
                </Grid>
                <Grid item xs={4}>
                    <Paper className={classes.alingPaper} elevation={4}>
                    Conteúdo da Coluna 3
                    </Paper>
                </Grid>
            </Grid>
            </Box>
        </Box>
    )
}
export default PageMain
